class Grid extends Component{

    render(){

        var arr=[];

        function newBlock(){
            return (<div className="block"></div>);
        }

        for(var i=0;i<20;i++){
            arr.push(newBlock);
        };


        return(
            <div>{arr}</div>
        );
    }
}

export default Grid;
